import styled from 'styled-components';
import Ethereum from './Ethereum';


const Container = styled.div`
                        display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: center;
                      width: 360px;
                      padding: 0;
                      flex-wrap: nowrap;
                      overflow-x: scroll;
                      overflow-y: hidden;
                      white-space: nowrap;
                      -webkit-overflow-scrolling: touch;
  }
`;



const NetworkCardsContainer = (props) => {
    return (  
    <Container>
    <Ethereum/>
    </Container>
        );
  }

  export default NetworkCardsContainer;
